import { BrowserRouter, Link } from "react-router-dom";
import React from "react";
import Wdata from "./WatchData";

const UrlParser = () => {
  return (
    <>
      {Wdata.map((product) => (
        <Link
          to={
            "/collection/" +
            product.id +
            "/" +
            product.title +
            "/" +
            product.price +
            "/" +
            product.imgsrc
          }
        >
          <p> {product.title} </p>
        </Link>
      ))}
    </>
  );
};

export default UrlParser;
